import react from "react";
import styles from "./MealItem.module.css";
const MealItem = () => {
  return <div className={styles.meal}>
    <div>
    <h3>Sushi</h3>
    <p className={styles.description}>Finest fish</p>
    <p className={styles.price}>$22.99</p>
    </div>
  </div>;
};
export default MealItem;
